export function VoterReducer(state, action) {
    const initialState = state;
    const updatedState = state;

    const mockElections = [
        {
            title: "Mock Election 1",
            totalVotes: 45780,
            opens: "1 January 1990, 9:00AM",
            closes: "1 January 1990, 5:00PM"
        },
        {
            title: "Mock Election 2",
            totalVotes: 3869,
            opens: "2 January 1990, 9:00AM",
            closes: "2 January 1990, 5:00PM"
        },
        {
            title: "Mock Election 3",
            totalVotes: 87901,
            opens: "3 January 1990, 9:00AM",
            closes: "3 January 1990, 5:00PM"
        },
        {
            title: "Mock Election 4",
            totalVotes: 87901,
            opens: "3 January 1990, 9:00AM",
            closes: "3 January 1990, 5:00PM"
        },
        {
            title: "Mock Election 5",
            totalVotes: 87901,
            opens: "3 January 1990, 9:00AM",
            closes: "3 January 1990, 5:00PM"
        },
        {
            title: "Mock Election 6",
            totalVotes: 87901,
            opens: "3 January 1990, 9:00AM",
            closes: "3 January 1990, 5:00PM"
        }
    ];

    switch (action.type) {
        case 'attempLoadElections':
            updatedState.elections = mockElections;
            updatedState.electionsLoaded = true;
            return updatedState;
        default:
            return initialState;
    }
}
